import { NavLink } from "react-router-dom";
import SearchBar from "../SearchBar/searchBar";
import style from "./Nav.module.css"
import { useDispatch } from "react-redux";
import { filterRecipeByOrigin } from "../../Redux/actions";

export default function Nav() {
 const dispatch = useDispatch();
 
 const handleClick = (e) =>{
  console.log(e.target.value)
   dispatch(filterRecipeByOrigin(e.target.value))
 }
 
 
  return (
    <div className={style.nav}>
      <NavLink to="/home" className={style.botones}>
        <span>Home</span>
      </NavLink>
      <NavLink to="/form" className={style.botones}>
        <span>Cre√° tu receta</span>
      </NavLink>
      <NavLink to="/about" className={style.botones}>
        <span>About</span>
      </NavLink>
      <NavLink onClick={()=> handleClick} value= "api" className={style.botonesfiltro}>
        <span>Nuestras recetas</span>
      </NavLink>
      <NavLink onClick={()=> handleClick} value= "bdd" className={style.botonesfiltro}>
        <span>Tus recetas</span>
      </NavLink>
        <SearchBar/>
    </div>
  );
}
